import React from 'react';

const style = {
    marginBottom:'10px',
    marginLeft: '10px',
    marginRight: '10px'
}

function checkLogin(){
    return(
        <div>
        <div className="has-text-centered">
        <img  src={"https://firebasestorage.googleapis.com/v0/b/konfhub.appspot.com/o/'%2Fconference-photos%2F'512.png?alt=media&token=61deb793-2ded-42b2-808e-9b08b5b0bfa4"}  height="62" width="62"/>
        </div>
        <input className="input is-primary marginLR" name="id" placeholder='Event Id' />
        <div className="has-text-centered">
        <button className="button is-primary is-normal radiusBtn">Login</button>
        </div>
        </div>
    )
}
export default checkLogin;
